  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for San Francisco
  Bay NWR, San Pablo Bay NWR, Antioch Dunes NWR, Farallon NWR, Ellicott Slough NWR,
  and Salinas River NWR outlines Refuge accomplishments during the 1990 calendar year.
  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, compliance with environmental and cultural resource mandates,
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, manpower programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, grasslands, grazing, haying, fire management, pest control,
  and wilderness areas. The wildlife section of the report discusses endangered and
  threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  marine mammals, fisheries resources, wildlife propagation, animal control, and marking
  and bird banding. The public uses of the Refuge described in this report include
  outdoor classrooms, interpretive programs, fishing, wildlife observation, outdoor
  recreation, and law enforcement. The equipment and facilities section of the report
  provides information about new construction, rehabilitation, major maintenance,
  equipment replacement, communication systems, and energy conservation.\",\n\t\"owner_org\":
